import { useEffect } from "react";
import { deleteAllCookies, getCookie } from "../../helpers/cookie"
import { useNavigate } from "react-router-dom";

function LogOut(){
    const navigate = useNavigate();
    const token = getCookie("token");
    deleteAllCookies();

    useEffect(() => {
        navigate("/login");
    },[])

    
    return (
        <>
        page LogOut
        </>
    )
}
export default LogOut
